from typing import List
'''
1590. 使数组和能被 P 整除

利用前缀和，计算前i个数的和对p取模的结果。
由(y - x) mod p == 0 → y mod p == x mod p 可知，只需寻找连续的数组，使其对p的模等于整个数组对p的模，即为所求。
'''
class Solution:
    def minSubarray(self, nums: List[int], p: int) -> int:
        if (target := sum(nums) % p) == 0:
            return 0
        presum = 0
        indexdict = {0: -1}
        res = len(nums)
        for i, num in enumerate(nums):
            presum = (presum + num) % p
            indexdict[presum] = i
            if (index := (presum + p - target) % p) not in indexdict:
                continue
            res = min(res, i - indexdict[index])
        return -1 if res == len(nums) else res


